function sanitizeDateFields(entry) {
  const dateFields = ['start_date', 'end_date'];

  for (const key of dateFields) {
    if (entry[key] === "UNKNOWN" || entry[key] === "null") {
      entry[key] = null;
    }
  }

  return entry;
}

